webpackJsonp([0xd24a01c650cc],{663:function(A,e){A.exports={data:{markdownRemark:{headings:[{value:"Concept",depth:2},{value:"The Kit",depth:2}],html:'<h2>Concept</h2>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte202-d8e1fefe377417fdc4eab7ffece8c8ea-35578.jpg"\n        srcset="/static/cochlea_lecompte202-d8e1fefe377417fdc4eab7ffece8c8ea-21994.jpg 375w,\n/static/cochlea_lecompte202-d8e1fefe377417fdc4eab7ffece8c8ea-f7c9d.jpg 750w,\n/static/cochlea_lecompte202-d8e1fefe377417fdc4eab7ffece8c8ea-35578.jpg 1500w,\n/static/cochlea_lecompte202-d8e1fefe377417fdc4eab7ffece8c8ea-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Cochlea Ear Care Kit is a medical set intended for children who suffer from chronic ear infections. The kit is designed in order to educate both children and parents about ear infections while also providing relief and care for the infection. Children are the largest contractors of ear infections their narrow eustachian tubes within the ear, and there is very little that can be done to provide relief for the discomfort that comes with them. If infections are left untreated it can lead to serious hearing loss and overall damage to the inner workings of the ear.</p>\n<p>Ear infections are painful because of inflammation and buildup of fluids in the middle ear. If left untreated infections can lead to diminished hearing and speech delays if the problem becomes serious or chronic. Even a one-off infection or a mild infection can result in permanent hearing loss if left untreated.</p>\n<h2>The Kit</h2>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte203-a4daac55c4c9201f1e15e7079cbc0896-35578.jpg"\n        srcset="/static/cochlea_lecompte203-a4daac55c4c9201f1e15e7079cbc0896-21994.jpg 375w,\n/static/cochlea_lecompte203-a4daac55c4c9201f1e15e7079cbc0896-f7c9d.jpg 750w,\n/static/cochlea_lecompte203-a4daac55c4c9201f1e15e7079cbc0896-35578.jpg 1500w,\n/static/cochlea_lecompte203-a4daac55c4c9201f1e15e7079cbc0896-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.27777777777777%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte204-138200bbdb41f9dd26c8e415b70b97bc-35578.jpg"\n        srcset="/static/cochlea_lecompte204-138200bbdb41f9dd26c8e415b70b97bc-21994.jpg 375w,\n/static/cochlea_lecompte204-138200bbdb41f9dd26c8e415b70b97bc-f7c9d.jpg 750w,\n/static/cochlea_lecompte204-138200bbdb41f9dd26c8e415b70b97bc-35578.jpg 1500w,\n/static/cochlea_lecompte204-138200bbdb41f9dd26c8e415b70b97bc-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The package’s name is derived from snail shaped part of the inner ear that’s responsible for hearing, which is called the cochlea. The clean, round shape of the container allows for the product to come off as friendly, but still medical and professional looking. </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte205-8a835b7370e180f7ebdad720c83ff2eb-35578.jpg"\n        srcset="/static/cochlea_lecompte205-8a835b7370e180f7ebdad720c83ff2eb-21994.jpg 375w,\n/static/cochlea_lecompte205-8a835b7370e180f7ebdad720c83ff2eb-f7c9d.jpg 750w,\n/static/cochlea_lecompte205-8a835b7370e180f7ebdad720c83ff2eb-35578.jpg 1500w,\n/static/cochlea_lecompte205-8a835b7370e180f7ebdad720c83ff2eb-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Inside the kit, there are easy access drawers that people can pull out when laying on their side. People with ear infections are often laying on their side for two reasons. They are either lying on the opposite side of the infected ear to administer drops that need time to drip and enter the ear canal, or because they are lying on the side with the infected ear to provide relief and drainage. </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte206-3d3f7de31a4002091ce04888f75a9685-35578.jpg"\n        srcset="/static/cochlea_lecompte206-3d3f7de31a4002091ce04888f75a9685-21994.jpg 375w,\n/static/cochlea_lecompte206-3d3f7de31a4002091ce04888f75a9685-f7c9d.jpg 750w,\n/static/cochlea_lecompte206-3d3f7de31a4002091ce04888f75a9685-35578.jpg 1500w,\n/static/cochlea_lecompte206-3d3f7de31a4002091ce04888f75a9685-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The top slot of the drawer contains a informational booklet in order to teach the user about the ear and ear infections. There is also a dosage card with instructions on how to administer ear drops in order for the user to know how to use the drops as well as keep track of how many drops they have used.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 63.77777777777778%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte207-2911cff54023d966b7c7db9f22fe702c-35578.jpg"\n        srcset="/static/cochlea_lecompte207-2911cff54023d966b7c7db9f22fe702c-21994.jpg 375w,\n/static/cochlea_lecompte207-2911cff54023d966b7c7db9f22fe702c-f7c9d.jpg 750w,\n/static/cochlea_lecompte207-2911cff54023d966b7c7db9f22fe702c-35578.jpg 1500w,\n/static/cochlea_lecompte207-2911cff54023d966b7c7db9f22fe702c-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The Care drawer is for treatment of the infection. It contains medicine, cotton balls and a bag. When one contracts an ear infection, fluid may tend to drain from the ear and a cotton ball is used to prevent leakage of fluids from exiting the ear. The bag is to dispose of the cotton balls after they have become soiled.  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.33333333333333%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte208-94c335fe0fca4a65223a94f704b45641-35578.jpg"\n        srcset="/static/cochlea_lecompte208-94c335fe0fca4a65223a94f704b45641-21994.jpg 375w,\n/static/cochlea_lecompte208-94c335fe0fca4a65223a94f704b45641-f7c9d.jpg 750w,\n/static/cochlea_lecompte208-94c335fe0fca4a65223a94f704b45641-35578.jpg 1500w,\n/static/cochlea_lecompte208-94c335fe0fca4a65223a94f704b45641-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The Clean drawer relates to keeping the ear clean. You cannot get water in the ear canal while the ear is infected, so silicone earplugs are necessary to block out water. The cotton swabs are provided to clean up any excess debris that may have dried on the outer part of the ear before inserting the earplug.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte209-a1a3f715d4e658ec0608270ff9bdcf19-35578.jpg"\n        srcset="/static/cochlea_lecompte209-a1a3f715d4e658ec0608270ff9bdcf19-21994.jpg 375w,\n/static/cochlea_lecompte209-a1a3f715d4e658ec0608270ff9bdcf19-f7c9d.jpg 750w,\n/static/cochlea_lecompte209-a1a3f715d4e658ec0608270ff9bdcf19-35578.jpg 1500w,\n/static/cochlea_lecompte209-a1a3f715d4e658ec0608270ff9bdcf19-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The Comfort drawer contains a snail-shaped heating pad which can provide both relief and comfort to children, as the heat can make the ear feel better, and the snail is a companion the child can have with them to help get them through the infection.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.27777777777777%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte210-a0a32582705ae5b211fe1b2475a025af-35578.jpg"\n        srcset="/static/cochlea_lecompte210-a0a32582705ae5b211fe1b2475a025af-21994.jpg 375w,\n/static/cochlea_lecompte210-a0a32582705ae5b211fe1b2475a025af-f7c9d.jpg 750w,\n/static/cochlea_lecompte210-a0a32582705ae5b211fe1b2475a025af-35578.jpg 1500w,\n/static/cochlea_lecompte210-a0a32582705ae5b211fe1b2475a025af-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>On the back of the kit, there is a slotted opening where a tray piece can be inserted and used a entertainment stand for items such as phones or books.</p>\n<p>This relates back to having to lay on one’s side so often, as people can often get bored or lose track of time. By having a way to hold up a device, you can keep track of the time to see how long you need to lay on your side for, as well as keep yourself entertained while you wait for the drops to enter the ear canal.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/cochlea_lecompte211-a3ba0bcbd715460f7d534e0d1fbabb06-35578.jpg"\n        srcset="/static/cochlea_lecompte211-a3ba0bcbd715460f7d534e0d1fbabb06-21994.jpg 375w,\n/static/cochlea_lecompte211-a3ba0bcbd715460f7d534e0d1fbabb06-f7c9d.jpg 750w,\n/static/cochlea_lecompte211-a3ba0bcbd715460f7d534e0d1fbabb06-35578.jpg 1500w,\n/static/cochlea_lecompte211-a3ba0bcbd715460f7d534e0d1fbabb06-061ae.jpg 1800w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>See more about Cochlea Ear Care Kit <a href="http://www.chelsealecompte.com/cochlea-ear-care-kit/">here.</a></p>',frontmatter:{title:"Cochlea Ear Care Kit",graduate:"Chelsea Lecompte",category:"Package Design",category2:null,category3:null,image:{childImageSharp:{sizes:{base64:"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAAHCAIAAACHqfpvAAAACXBIWXMAAAsSAAALEgHS3X78AAAAbElEQVQY02NQMyzEhVQNCoAIjwIGXBLqRkXaZiUaxkWqBiRqVjEo0DUvDU+Y5BfeTY7NOualTt4tQdF9xnaVuBzPgMvNNq71Nm4NLr6tvmHd+lblKtj0M+BxFTjMCjWMi4FmkeZsmBMK8QQYAK88cJMS5pYCAAAAAElFTkSuQmCC",aspectRatio:1.5,src:"/static/cochlea_lecompte201-88ceefbd243723aa3178300e3e1c1c6e-0f681.png",srcSet:"/static/cochlea_lecompte201-88ceefbd243723aa3178300e3e1c1c6e-c1674.png 375w,\n/static/cochlea_lecompte201-88ceefbd243723aa3178300e3e1c1c6e-34f47.png 750w,\n/static/cochlea_lecompte201-88ceefbd243723aa3178300e3e1c1c6e-0f681.png 1500w,\n/static/cochlea_lecompte201-88ceefbd243723aa3178300e3e1c1c6e-8123c.png 2000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}},projectsInCategory:{edges:[{node:{fields:{slug:"/work/24-season-food/"},frontmatter:{title:"24-Season Food",graduate:"Anna De-Jia Li",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-73620.jpg",srcSet:"/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-5fe7a.jpg 150w,\n/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-a5834.jpg 300w,\n/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-73620.jpg 600w,\n/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-02892.jpg 900w,\n/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-7726d.jpg 1200w,\n/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-7460d.jpg 1800w,\n/static/ali_seasons-1-bf8818e405715d68b0f68c2cbfbfbffe-de380.jpg 2000w",sizes:"(max-width: 600px) 100vw, 600px"}}}}}},{node:{fields:{slug:"/work/beausoleil-environmental-sustainability-in-package-design/"},frontmatter:{title:"Beausoleil - Environmental Sustainability in Package Design",graduate:"Angela Ip ",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-73620.jpg",srcSet:"/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-5fe7a.jpg 150w,\n/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-a5834.jpg 300w,\n/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-73620.jpg 600w,\n/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-02892.jpg 900w,\n/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-7726d.jpg 1200w,\n/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-7460d.jpg 1800w,\n/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-de380.jpg 2000w",sizes:"(max-width: 600px) 100vw, 600px"}}}}}}]},projectByStudent:{edges:[{node:{fields:{slug:"/work/nova-scotia-fibre-arts-festival/"},frontmatter:{title:"Nova Scotia Fibre Arts Festival ",graduate:"Chelsea Lecompte",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-73620.jpg",srcSet:"/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-5fe7a.jpg 150w,\n/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-a5834.jpg 300w,\n/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-73620.jpg 600w,\n/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-02892.jpg 900w,\n/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-7726d.jpg 1200w,\n/static/fibrearts_lecompte101-57123e149d7a5905ca38ab21f9d2de2e-7460d.jpg 1800w",sizes:"(max-width: 600px) 100vw, 600px"}}}}}}]}},pathContext:{slug:"/work/cochlea-ear-care-kit/",name:"/Cochlea Ear Care Kit/",title:"Cochlea Ear Care Kit",graduateName:"Chelsea Lecompte",graduate:"/Chelsea Lecompte/",category:"/Package Design/"}}}});
